import React from 'react'

const Menu = (props) => (
    <div className={'menu'}>
        {props.buttons.map((button, key) => (
            <MenuButton
                key={key}
                button={button}
                onChangeHeading={props.onChangeHeading}
            />
        ))}
    </div>
);

export default Menu
